  

// TypeScript Version: 4.1

/**
* Computes the principal square root of a single-precision floating-point number.
*
* ## Notes
*
* -   For `x < 0`, the principal square root is not defined.
*
* @param x - input value
* @returns square root of `x`
*
* @example
* var v = sqrtf( 4.0 );
* // returns 2.0
*
* @example
* var v = sqrtf( 9.0 );
* // returns 3.0
*
* @example
* var v = sqrtf( 0.0 );
* // returns 0.0
*
* @example
* var v = sqrtf( -4.0 );
* // returns NaN
*
* @example
* var v = sqrtf( NaN );
* // returns NaN
*/
declare function sqrtf( x: number ): number;


// EXPORTS //

export = sqrtf;
